criteria:
Inclusion Criteria:

  1. Patients with pathologic or/and FNAC confirmation of advanced cancer but without
     effective treatment or with treatment failure;

  2. Between 18 and 65 years of age, KPS≥70;

  3. According to RECIST 1.1,patients with at least one tumor lesion that can accurately be
     measured by CT or MRI in at least one dimension with longest diameter to be recorded
     as >2.0cm by general CT or >1.0cm by spiral CT;

  4. Life expectancy of at least three (3) months at the enrollment;

  5. Patients who have sufficient baseline organ function and whose laboratory data can
     meet the following criteria at the enrollment:

       -  PLT count≥100×10~9/L,

       -  WLB count≥4.0×10~9/L and ≤12×10~9/L,

       -  Neutrophil granulocyte count≥2.0×10~9/L,

       -  HGB count≥90g/L,

       -  Total bilirubin <=1.5 times of ULN,

       -  ALT/AST ≤2.5 times of ULN,

       -  SCr≤1.5 times of ULN,

       -  Normal ECG with LVEF (≥50%) measured by echocardiography;

  6. Female patients with negative pregnant test, and male/female patients of reproductive
     age without pregnancy planning in the next 12 months;

  7. Volunteered for the phase 1 trial and sign the informed consent without protest;

Exclusion Criteria:

  1. Patients who have received large area radiotherapy （>30% marrow capacity）;

  2. Patients who suffer from other serious complication, such as uncontrollable infection,
     myocardial infarction within the past 6 months at the enrollment , uncontrollable
     hypertension ,thromboembolism and etc.;

  3. Symptomatic patients with brain metastases (except for the patients whose brain
     metastases is controlled to stable status after whole brain radiotherapy);

  4. Patients who have received the therapy of chemotherapy within 4 weeks before
     enrollment;

  5. Patients who have used nitrosoureas drug or mitomycin within 6 weeks or tyrosine
     kinase inhibitor within 2 weeks before enrollment;

  6. Patients who have received therapy of major surgery within 6 weeks or biopsy surgery
     within 2 weeks before enrollment;

  7. Patients who or have received radical radiotherapy within 6 weeks or local palliative
     radiotherapy within 2 weeks before enrollment;

  8. Patients who experience grade 2 or more than grade 2 toxicity caused by the past
     therapies;

  9. Patients who have history of drug abuse or alcoholism;

 10. Patients who smoke over 5 cigarettes or equivalent tobacco per day;

 11. Uncontrollable psychopaths;

 12. Pregnant or breast-feeding women, or patients(male and female) who have pregnancy
     plan;

 13. Patients who had received a therapy of another investigational drug within 4 weeks or
     patients who are still in another clinical trial at the enrollment;

 14. Known active hepatitis B/hepatitis C, positive HIV/ syphilis antibody;

 15. Patient who need long term treatment of cortical hormone or other immunosuppressive
     drugs such as visceral organ transplanters;

 16. Allergic to the investigational drug;

 17. Other patients judged ineligible for enrollment in the study by the investigator
     (sub-investigator).

Inclusion Criteria - All Phases:

  1. Males and females ≥18 years of age;

  2. Eastern Cooperative Oncology Group (ECOG) Performance Status of ≤1

  3. Acceptable bone marrow and organ function at screening as described below:

       1. ANC ≥ 1,500/µL;

       2. Platelet count ≥ 100,000/µL;

       3. Total bilirubin ≤ 1.5 × ULN or ≤ 3.0 × ULN for subjects with hereditary benign
          hyperbilirubinemia;

       4. AST (SGOT) ≤ 3 × ULN (≤ 5 × ULN if liver metastases are present);

       5. ALT (SGPT) ≤ 3 × ULN (≤ 5 × ULN if liver metastases are present);

       6. Serum creatinine ≤ 1.5 mg/dL or a measured creatinine clearance ³ 60 mL/min
          according to Cockcroft-Gault formula

  4. Left ventricular ejection fraction informed (LVEF) ≥ 55%;

  5. Ability to swallow and retain oral medications;

  6. Negative serum beta-human Chorionic Gonadotropin (β-hCG) test in women of childbearing
     potential (WOCBP); Note, subject must agree to use dual barrier contraceptive methods;
     and

  7. Willing and able to provide written informed consent and comply with the requirements
     of the study;

  8. Phase 1a Dose Escalation only - Histologically confirmed advanced solid tumor for
     which standard therapy does not exist or is no longer effective

  9. Food Effect Stage - willing and able to ingest a standard meal

 10. Phase 1b All Expansion Cohorts - Evidence of measurable disease per RECIST, v1.1.
     Measurable disease is defined as a lesion that can be accurately measured in at least
     1 dimension (longest diameter to be recorded) with a minimum size of 10 mm by computed
     tomography (CT) scan;

 11. Phase 1b All Expansion Cohorts - Prior treatment with embolization or ablative
     therapies is allowed if measurable disease remains outside of the treated area or if
     there is definitive progression in the treated lesions. There is no limit on the
     number of prior procedures;

 12. Phase 1b Dose Expansion RAS Mutated mCRC Arm only - Histologically confirmed
     colorectal cancer with a K-RAS or N-RAS mutation in exons 2,3 and 4 that is metastatic
     or unresectable;

 13. Phase 1b Dose Expansion RAS Mutated mCRC Arm only - At least 2 prior systemic
     therapies for the treatment of metastatic colorectal cancer. Neo-adjuvant and adjuvant
     therapies may not be counted as part of the prior therapy requirements. At least 7
     subjects should be naïve to treatment with regorafenib;

 14. Phase 1b Optional Dose Expansion Advanced RCC Arm only - Histologically confirmed
     metastatic renal cell carcinoma;

 15. Phase 1b Optional Dose Expansion Advanced RCC Arm only - Must have received 2 prior
     therapies for metastatic RCC, including a vascular endothelial growth factor receptor
     (VEGFR) tyrosine kinase inhibitor (TKI) and an immune checkpoint inhibitor (ie
     anti-PD-1) (if approved and available for commercial use in the local country). At
     least 7 subjects should be naïve to treatment with prior inhibitors of mammalian
     target of rapamycin (mTOR) (eg. everolimus);

 16. Phase 1b Optional Dose Expansion pNET Arm only - Histologically confirmed low-grade or
     intermediate-grade, unresectable or metastatic pNET tumor for which standard therapy
     does not exist or is no longer effective. Functional and non-functional tumors can be
     included;

 17. Phase 1b Optional Dose Expansion RAS-MAPK Pathway Mutation Arm only - Histologically
     confirmed malignancy with a RAS-MAPK pathway mutation that is metastatic or
     unresectable and for which standard therapy does not exist or is no longer effective.
     At least 10 subjects with non-small cell lung cancer (NSCLC) are to be enrolled in
     this arm.

Exclusion Criteria - All Phases

  1. Any prior treatment (with the exception of somatostatin analogues, which are allowed
     before and during the study in pNET subjects at the investigator discretion in pNET
     subjects) such as chemotherapy, immunomodulatory drug therapy, anti-neoplastic
     hormonal therapy (unless dose has been stable for 3 months prior to Baseline and will
     remain stable during the study), immunosuppressive therapy, or corticosteroids (unless
     administered to prevent contrast material reactions during radiographic procedures)
     received within the past 28 days or 5 half-lives, whichever is shorter;

  2. Presence of an acute or chronic toxicity resulting from prior chemotherapy, with the
     exception of alopecia, that has not resolved to ≤ grade 1, as determined by NCI CTCAE
     v 4.0 (http://evs.nci.nih.gov/ftp1/CTCAE/About.html);

  3. Received radiotherapy within the last 21 days (limited palliative radiation is allowed
     if ≥ 14 days prior);

  4. Subjects with primary brain tumors or known central nervous system (CNS) metastases;

  5. Major surgery < 28 days from the start of treatment (major surgery is defined as a
     procedure requiring general anesthesia);

  6. Minor surgery <14 days from the start of treatment (insertion of a vascular access
     device is not considered major or minor surgery);

  7. Active infection requiring systemic therapy;

  8. Known to be human immunodeficiency virus (HIV) positive or have an acquired
     immunodeficiency syndrome-related illness;

  9. Uncontrolled congestive heart failure, angina, myocardial infarction, cerebrovascular
     accident, coronary/peripheral artery bypass graft surgery, transient ischemic attack,
     or pulmonary embolism within 3 months prior to initiation of study drug;

 10. History of or ongoing cardiac dysrhythmias requiring treatment, atrial fibrillation of
     any grade, or persistent prolongation of the QTc (Fridericia) interval to > 450 msec
     for males or > 470 msec for females;

 11. History of esophageal bleeding due to varices;

 12. Gastrointestinal disease that may interfere with the absorption of orally-administered
     drugs;

 13. History of inflammatory bowel disease or other illness resulting in chronic diarrhea;

 14. Known achlorhydria or history of gastrointestinal surgery that could reduce the
     acidity of the stomach;

 15. Acute pancreatitis or cholecystitis within 6 months prior to Baseline;

 16. Cirrhosis with severe liver dysfunction (Child-Pugh Class B or C);

 17. Previous or concomitant malignancy, except for basal-cell or squamous cell carcinoma
     of the skin or carcinoma-in-situ of the uterine cervix. Subjects with other
     malignancies are eligible if they have remained disease free for at least 2 years
     prior to study entry;

 18. Any severe, acute, or chronic medical or psychiatric condition, or laboratory
     abnormality that may increase the risk associated with study participation or study
     drug administration, may interfere with the informed consent process and/or with
     compliance with the requirements of the study, or may interfere with the
     interpretation of the study results and, in the Investigator's opinion, would make the
     subject inappropriate for entry into this study;

 19. Use of any investigational agents within 28 days or 5 half-lives (whichever is
     shorter) prior to Baseline;

 20. A condition that is expected to require concomitant use of any medication listed as
     prohibited while on study;

 21. Pregnant or lactating female;

 22. Women of childbearing potential, or men who partner with a woman of childbearing
     potential, unless they agree to use dual barrier contraceptive methods which, in the
     Investigator's opinion, are effective and adequate for that subject's circumstances
     while on study drug and for 3 months afterward;

 23. Grade 3 or 4 eye disorder at study entry, unless stable and longstanding (>3 months)
     and unlikely to interfere with protocol-required ophthalmology assessments;

 24. Phase 1b Optional Dose Expansion pNET Arm only - Poorly differentiated pNET;

 25. Phase 1b Optional Dose Expansion RAS-MAPK Pathway Mutation Arm only - Subjects with
     primary pancreatic cancer or primary RAS mutated colorectal cancer.

Inclusion Criteria:

  1. aged 30-65;

  2. diagnosed to be type 2 diabetes in accordance with the WHO diagnostic criteria in 1999
     .

  3. diabetes duration for 5 years or less;

  4. the glycosylated hemoglobin (HbA1c) is higher than or equal to7.0% ;

  5. body mass index (BMI) 20-35 kg/m2;

  6. fluorescein fundus angiography (FFA) showed no diabetic retinopathy;

  7. women of childbearing-age have birth control plan for 5 years plan;

Exclusion Criteria:

  1. pregnant or lactating women;

  2. diabetes autoantibodies (GAD) antibodies positive;

  3. occurred state of diabetic ketoacidosis, diabetes, high permeability, diabetes lactic
     acidosis within a half years ;

  4. aspartate aminotransferase (AST), alanine aminotransferase (ALT) 2.5 times higher than
     normal ceiling, and/or serum creatinine (Cr) or 133 umol/l (1.5 mg/dl);

  5. hemoglobin disease history which can affect determination of HbA1c;

  6. have received a coronary angioplasty, coronary artery stent implantation, coronary
     artery bypass surgery, there was myocardial infarction, unstable angina, and clinical
     significance of abnormal ecg, cerebrovascular accident, or transient ischemic attack.

  7. psychiatric patients;

  8. any eye eyesight < 0.1 patients (WHO blind eye disease: keratitis, need serious
     cataract surgery, glaucoma, uveitis, high myopia shaft > 26.5 mm, history of ocular
     trauma;Other ophthalmology medical history: the central vein occlusion, branch vein
     occlusion, wet sex senile macular degeneration, etc.;

  9. in eye surgery history, history of cataract surgery, and three months; Other serious
     diseases, the researchers think that don't fit into the patients

Inclusion Criteria:

  -  Meets the National Institute of Neurological and Communicative Disorders and
     Stroke/Alzheimer's Disease and Related Disorders Association criteria for probable
     Alzheimer's disease (AD);

  -  Has a Mini-Mental State Examination total score of 16 to 26;

  -  Has a Modified Hachinski Ischemia Scale score of ≤ 4;

  -  Is taking a stable dose of donepezil, galantamine or rivastigmine for at least 30
     days;

  -  Has had a computerized tomography or magnetic resonance imaging. The scan must not
     show evidence for an alternative etiology for dementia;

  -  With the exception of a diagnosis of mild-to-moderate AD and the presence of stable
     medical conditions, is in general good health.

Exclusion Criteria:

  -  Positive screen for drugs of abuse, alcohol or cotinine;

  -  Females must not have positive results for pregnancy;

  -  Focal neurological signs on examination;

  -  Has a clinically significant abnormal value, in serum chemistry, hematology or
     urinalysis;

  -  History of any significant neurologic disease other than AD;

  -  History of head trauma, motor vehicle accident, concussion.

Inclusion Criteria:

  1. Subjects must be at least 18 years of age;

  2. Subjects must be post-allogeneic transplant from any donor source;

  3. Subjects must have either:

       1. High risk CD34+ AML (de novo or secondary, and any WHO 2008 classification
          excluding acute promyelocytic leukemia). High risk AML is defined as (a) disease
          status beyond complete remission (CR) #1 at transplant or (b) treatment related
          AML or (c) presence of adverse cytogenetics including inv(3); t(3;3); t(6;9);
          t(v;11); -5 or del(5q); -7; abnl(17p) or complex karyotype; or

       2. High risk CD34+ MDS (WHO 2008 classification). High risk is defined as (a) blast
          count ≥5% at the time of transplant or (b) treatment related MD or (c) presence
          of adverse cytogenetics including -7/del7q or complex karyotype;

  4. For AML subjects, they must have a documented CR within 45 days prior to allo-HCT;

  5. For MDS subjects, they must have < 20% myeloblasts in the bone marrow within 45 days
     prior to allo-HCT;

  6. Subject Karnofsky performance status must be ≥ 70;

  7. Subjects must be platelet transfusion independent (Platelet transfusion independence
     is defined as 7 days or greater without a platelet transfusion);

  8. Neutrophil count ≥ 1.0 thou/mm3 and platelet count ≥ 30 thou/mm3;

  9. Subjects must have total bilirubin ≤ 2 mg/dL;

 10. Subjects must have serum AST and ALT levels ≤ 2.5 times upper limit of normal;

 11. Subjects must have serum creatinine < 2.5 times upper limit of normal and a calculated
     creatinine clearance > 30 ml/min by Cockcroft-Gault formula (see Appendix I:
     Cockcroft-Gault Creatinine Clearance Calculation);

 12. All study participants who will receive lenalidomide based on the CD34+ chimerism
     testing must be registered into the mandatory Revlimid REMS® program, and be willing
     and able to comply with the requirements of the REMS® program;

 13. Females of child-bearing potential (i.e., women who are premenopausal or not
     surgically sterile) may participate, provided they meet the following conditions:

     a) Females of reproductive potential must adhere to the scheduled pregnancy testing as
     required in the Revlimid REMS® program; and

 14. Written, voluntary informed consent, willingness, and ability to comply with all study
     procedures.

Exclusion Criteria:

  1. CD34- AML or MDS;

  2. Inability to give informed consent;

  3. Uncontrolled active infection(s) requiring intravenous antibiotics;

  4. Known or suspected hypersensitivity to lenalidomide;

  5. Grade II-IV acute GVHD or extensive GVHD;

  6. Not able to swallow the lenalidomide capsule as a whole;

  7. Female subjects who are pregnant or nursing.

Inclusion Criteria:

  1. Male or Female, aged ≥ 18 yrs and ≤70 yrs;

  2. Histological or cytological confirmation of non-Hodgkin's lymphoma（NHL）, including
     diffuse large B-cell lymphoma, peripheral T-cell lymphoma and other aggressive NHLs
     which determined by the investigator.

  3. Patients with NHL refractory to at least 2 different chemotherapies , for which no
     standard therapy exists;

  4. At least 1 lesion can be accurately measured, as defined by Lugano 2014 criteria.

  5. Eastern Cooperative Oncology Group (ECOG) Performance Status of 0 or 1;

  6. Subjects received anti-cancer therapy (including chemotherapy, radiotherapy,
     immunotherapy and surgical therapy, et al) should beyond 4 weeks prior to study entry;
     Subjects received mitomycin chemotherapy should beyond 6 weeks prior to study entry;
     Subjects received autologous stem cell transplantation should beyond 3 months prior to
     study entry;

  7. Laboratory criteria are as follows:

     Complete blood count: hemoglobin (Hb) ≥90g/L ; absolute neutrophil count (ANC)
     ≥1.5×109/L ; platelets >=90×109/L Biochemistry test: total bilirubin≦1.5×ULN; alanine
     aminotransferase(ALT) ,aspartate aminotransferase(AST)≦1.5×ULN; (ALT,AST≦5×ULN if
     liver involved) ;serum creatinine(cr)≦1.5×ULN; Coagulation test: International
     Normalized Ratio (INR) < 1.5

  8. Life expectancy of at least 12 weeks.

  9. Willingness to sign a written informed consent document.

Exclusion Criteria:

  1. Patients with prior invasive malignancies with the exception of curatively-treated
     basal cell or squamous cell carcinoma of the skin or cervical carcinoma in situ,
     unless received curative treatment and with documented evidence of no recurrence in
     the past five years;

  2. Clinical evidence of central nervous system involvement;

  3. Have uncontrolled or significant cardiovascular disease, including:

       1. Congestive heart failure, unstable angina pectoris, myocardial infarction within
          6 months prior to study entry; arrhythmia, or Left Ventricular Ejection Fraction
          (LVEF) < 50% requiring treatment with agents during screening stage.

       2. primary cardiomyopathy(dilated cardiomyopathy, hypertrophic cardiomyocyte,
          arrhythmogenic right ventricular cardiomyopathy, restrictive cardiomyopathy,
          et,al)

       3. History of significant QT interval prolongation, or Corrected QT Interval (QTc) >
          450 ms prior to study entry

       4. Symptomatic coronary heart disease requiring treatment with agents

       5. Uncontrolled hypertension (> 140/90 mmHg) by single agent;

  4. Have active bleeding current thrombotic disease, patients with bleeding potential ,or
     receiving anticoagulation therapy; within 2 months prior to screening;

  5. Proteinuria positive(≥1g/24h);

  6. History of deep vein thrombosis or pulmonary embolism;

  7. Have unsolved toxicities (> grade 1) from prior anti-cancer therapy;

  8. Have clinical significant gastrointestinal abnormality, e.g., unable to swallow,
     chronic diarrhea, ileus, that would impair the ingestion,transportation or absorption
     of oral agents, or patients undergone gastrectomy;

  9. History of organ transplantation or Allogeneic bone marrow transplantation;

 10. Major surgery within 6 weeks and minor surgery within 2 weeks prior to screening
     (excluding placement of vascular access or biopsy) that involved general anaesthesia
     or respiratory assistance;

 11. Serologically positive for HIV, hepatitis B or C, or other serious infectious
     diseases;

 12. History of interstitial lung disease(ILD);

 13. Previous treatment with aurora kinase inhibitors;

 14. Patients appropriate and ready for autologous stem cell transplantation;

 15. Any mental or cognitive disorder, that would impair the ability to understand the
     informed consent document or the operation and compliance of study;

 16. Candidate with drug and alcohol abuse;

 17. Participants of reproductive potential not willing to use adequate contraceptive
     measures for the duration of the study (both male and female participants).Pregnant or
     breastfeeding women. Female participants must have a negative urinary or serum
     pregnancy test when done or have evidence of post-menopausal status (Defined as
     absence of menstruation for greater than 12 months, bilateral oophorectomy or
     hysterectomy);

 18. Any other condition which is inappropriate for the study in the opinion of the
     investigators.

Inclusion Criteria:

  1. Age: 18 - 45 years;

  2. Sex: male and female;

  3. Ethnicity: Chinese;

  4. Good health as evidenced by the results of physical examination, vitals signs,
     electrocardiogram, and clinical laboratory test results, but there were exceptions if
     an abnormal value was considered not to be clinical significance;

  5. Written informed consent.

Exclusion Criteria:

  1. Any conditions known to interfere with the absorption, distribution, metabolism or
     excretion of drugs;

  2. Intolerance or hypersensitivity to drugs whose mechanism is similar to that of
     ticagrelor;

  3. Any history of taking medicines within half a month before enrollment;

  4. Any history of whole blood transfusion within 2 months, blood elements transfusion or
     blood donation within 1 months before enrollment;

  5. Participation in a clinical study within 3 months before enrollment;

  6. Abuse of caffeine (> 5 units/day), alcohol(> 21 units /week), smoking(> 10
     cigarettes/day);

  7. Positive serology for Hbs antigen and HIV;

  8. History of coagulation disorders.

Inclusion Criteria:

  1. Adult male and female subjects, ages 18-65;

  2. Active plaque psoriasis with ≥3% BSA involved;

  3. An adequate number of vulgar psoriatic plaques of at least 2 cm X 2 cm with Target
     Lesion Investigator Global Assessment scores >3, that are not located on the face,
     scalp, groin, genitals, folds, palms or soles

  4. Weight of 50 - 100 kg;

  5. Non-child bearing potential or willingness to use adequate contraception in order to
     prevent pregnancy from the screening visit until 60 days after the follow-up visit.

  6. Subject will be evaluated for latent TB infection.

  7. Able to communicate and able to provide valid, written informed consent;

Exclusion Criteria:

The following will exclude potential subjects from the study:

  1. Erythrodermic, predominantly guttate, exclusively palmar/plantar, or generalized
     pustular psoriasis;

  2. Current drug-induced or aggravated psoriasis (e.g., a new onset of psoriasis or an
     exacerbation of psoriasis from beta-blockers, calcium-channel blockers, or lithium
     carbonate);

  3. Use of the following concurrent systemic medications: corticosteroids, retinoids,
     cyclosporine, methotrexate, or biologic agents.

  4. Use of concurrent topical medications (must be discontinued at least 2 weeks prior to
     baseline);

  5. UVA or UVB therapy within 4 weeks of baseline;

  6. The presence of uncontrolled hypertension, uncontrolled diabetes, clinically
     significant cardiovascular disease, asthma or reduced pulmonary capacity, or a history
     of seizure or other neurologic disorder;

  7. Presence or history of pre-existing paresthesia or neuropathy;

  8. Abnormalities on neurological exam at screening or baseline;

  9. Clinically significant ECG abnormalities, in the opinion of the Investigator;

 10. History of any cancer requiring systemic chemotherapy or radiation;

 11. The presence of acute infection or history of acute infection as judged by the
     Investigator within 7 days of baseline;

 12. The presence of clinically significant laboratory abnormalities;

 13. A positive hepatitis screen (Hepatitis BsAg or anti-HCV) or positive Human
     Immunodeficiency Virus (HIV) antibody test ;

 14. History of treated or untreated TB

 15. Any history of anaphylaxis that is important in the view of the Investigator;

 16. Participation in another clinical trial with receipt of an investigational product
     within 90 days of baseline (or 5 half-lives of the previous drug, whichever is
     longer);

 17. History of alcohol abuse that is important in the view of the Investigator;

 18. Positive drug screen for amphetamines, barbituates, benzodiazepines, cocaine,
     cannabis, methamphetamine, methylenedioxymethanphetamine, opiates or phencyclidine

 19. Inadequate venous access that would interfere with obtaining blood samples;

 20. Positive pregnancy test at screening or at baseline or current lactation (female
     subjects only);

 21. Inability or unwillingness to comply with study restrictions, return for follow up
     appointments, or other considerations, in the opinion of the Investigator, which would
     make the candidate unsuitable for study participation.

Inclusion Criteria:

  1. Fully understand the study and voluntarily sign the informed consent form;

  2. Be at least 18 years old;

  3. Have a confirmed histological or cytological diagnosis of low- or intermediate-grade
     advanced NETs (unresectable or metastatic), for which standard treatment has failed or
     cannot be received. The NETs must meet the following criteria: (a) be GEP-NETs or NETs
     with the primary lesion located in tissue other than the lung or thymus (including
     unknown primary lesion location), with a mitotic count of ≤ 20/10 High Power Field
     [HPF] and a Ki67 index of ≤ 20%; or (b) be NETs of the lung or thymus (carcinoid) with
     a mitotic count of ≤ 10/10 High Power Field [HPF])

  4. Have measurable lesions (according to RECIST 1.1);

  5. Have a performance status (PS) of 0 or 1 on the Eastern Cooperative Oncology Group
     (ECOG) scale;

  6. Have expected survival of more than 12 weeks;

  7. Female patients with reproductive potential must agree to use an effective
     contraceptive method, for example, double-barrier device, condom, oral or injection
     birth control medication or intrauterine device, during the study and for 90 days
     after study completion.

Exclusion Criteria:

  1. Absolute neutrophil count (ANC) of < 1.5×109/L, or platelet count of < 100 ×109/L, or
     hemoglobin < 9 g/dL;

  2. Serum total bilirubin > 1.5 times the upper limit of normal (ULN);

  3. ALT, AST or ALP > 2.5 ULN without hepatic metastases or ALT, AST or ALP > 5 ULN with
     hepatic metastases

  4. Clinically significant serum potassium (regardless of potassium agent
     supplementation); serum calcium (ionic or binding to albumin post-adjusted) or
     clinically significant abnormal serum magnesium (regardless of magnesium agent
     supplementation);

  5. Serum creatinine > 1.5 ULN (with the exception of CCR ≥ 60 ml/min based on 24-hour
     urine collection);

  6. Urine protein > 2+, or 24-hour urine protein quantity >1 gram;

  7. Uncontrolled hypertension, defined as: systolic blood pressure ≥ 140 mmHg or diastolic
     blood pressure ≥ 90mmHg;

  8. International Normalized Ratio (INR) > 1.5 ULN or activated partial thromboplastin
     time (aPTT) > 1.5 ULN. INR is only for patients not receiving anticoagulant therapy;

  9. History or presence of digestive tract diseases, including active gastric/duodenal
     ulcer or ulcerative colitis, or active hemorrhage of an unresected gastrointestinal
     tumor, or an evaluation by investigators of having any other condition that could
     possibly result in gastrointestinal tract hemorrhage or perforation;

 10. History or presence of serious hemorrhage (> 30 ml within 3 months), hemoptysis (> 5
     ml fresh blood within 4 weeks) or a thromboembolic event (including transient ischemic
     attack) within 12 months;

 11. Clinically significant cardiovascular disease, including but not limited to, acute
     myocardial infarction within 6 months prior to enrolment, severe/unstable angina
     pectoris or coronary artery bypass grafting, New York Heart Association Class III/IV
     congestive heart failure, ventricular arrhythmias requiring treatment or left
     ventricular ejection fraction (LVEF) < 50%;

 12. Other malignancies within the previous 5 years, with the exception of basal cell
     carcinoma, squamous-cell carcinoma post radical resection, or cervical carcinoma in
     situ;

 13. Anti-tumor therapies within 4 weeks prior to the initiation of investigational
     treatment, including chemotherapy, radical radiotherapy, hormonotherapy, biotherapy
     and immunotherapy;

 14. Palliative radiotherapy for a bone metastasis lesion within 2 weeks prior to the
     initiation of investigational treatment;

 15. Surgery prior to enrolment within 28 days prior to the initiation of investigational
     treatment or unhealed surgical incision;

 16. Toxicity from a previous anti-tumor treatment that does not return to Grade 0 or 1
     (except for hair loss);

 17. Clinically significant active infection;

 18. Human immunodeficiency virus (HIV) infection;

 19. History of clinically significant hepatic diseases, including viral hepatitis,
     (Hepatitis B carriers with active HBV infection, i.e., HBV DNA positive [>1×104/ml];
     Hepatitis C virus infection with HBV RNA positive [>1×103/ml]); or other types of
     hepatitis, and liver cirrhosis.

 20. Women who are pregnant or lactating;

 21. Brain metastases and/or spinal cord compression untreated with surgery and/or
     radiotherapy, and without clinical imaging evidence of disease stability of longer
     than 14 days;

 22. Inability to orally take medicine, dysphagia or an active gastric ulcer resulting from
     previous surgery or a severe gastrointestinal disease, or any other condition that
     investigators believe may affect absorption of the investigational product;

 23. Receive investigational treatment in another clinical study within the 4 weeks prior
     to enrolment;

 24. Other disease, metabolic disorder, physical examination anomaly, abnormal laboratory
     result, or any other condition that investigators suspect may prohibit use of the
     investigational product, affect interpretation of study results, or put the patient at
     high risk.

Inclusion Criteria:

  -  Subjects aged ≥ 18 yrs and ≤ 65 yrs;

  -  Clinical diagnosis of one of the following hematological malignancies:

       -  Leukemia

       -  Myelodysplastic Syndromes

       -  Lymphomas

       -  Multiple Myeloma

       -  Other high-risk hematological malignancy eligible for stem cell transplantation
          per institutional standard;

  -  Recurrent disease that presents ≥100 days after, or minimal residual disease (MRD)
     that presents ≥ 30 days following a hematopoietic stem cell transplant (HSCT) using a
     matched unrelated donor located through the National Marrow Donor Program (NMDP);

  -  Life expectancy >10 weeks;

  -  Signed donor and patient/guardian informed consent;

  -  A 8/8 genotypic identical match as determined by high resolution typing for the
     following genetic loci: human leukocyte antigen (HLA)-A, HLA-B, HLA-C and HLA-DRB1;

  -  Performance status: Karnofsky score > 50%;

  -  Subjects with adequate organ function as measured by:

       -  Bone marrow:

            -  > 25% donor T-cell chimerism post-transplant

            -  Absolute neutrophil count (ANC) >1 x 109/L

       -  Cardiac: left ventricular ejection fraction (LVEF) at rest ≥ 45%

       -  Pulmonary: forced expiratory volume (FEV) 1, forced vital capacity (FVC),
          diffusion capacity of lunch for carbon monoxide (DLCO) ≥ 50% predicted (corrected
          for hemoglobin)

       -  Hepatic: direct bilirubin ≤ 3x upper limit of normal (ULN), or aspartate
          aminotransferase (AST)/alanine aminotransferase (ALT) ≤ 5x ULN

       -  Renal: creatinine ≤ 2x of ULN for age.

Exclusion Criteria:

  -  ≥ Grade II acute GVHD or chronic extensive GVHD due to a previous allograft at the
     time of screening;

  -  Active central nervous system (CNS) involvement with malignant cells (≤ 2 months prior
     to consenting);

  -  Current uncontrolled bacterial, viral or fungal infection (currently taking medication
     with evidence of progression of clinical symptoms or radiologic findings); the
     principal investigator is the final arbiter of this criterion;

  -  Positive HIV serology or viral RNA;

  -  Pregnancy (positive serum β human chorionic gonadotropin [HCG] test) or
     breast-feeding;

  -  Fertile men or women unwilling to use effective forms of birth control or abstinence
     for one year after transplantation;

  -  Bovine product allergy.

Inclusion Criteria:

  -  Age 18-45 years old;

  -  Diagnosed with active RA;

  -  DMARDs therapy must not be used for at least 28 days prior to baseline;

  -  If a patient has received NSAIDs，current NSAIDs therapy must have been at a stable
     dose for at least 28 days prior to baseline;

  -  Patient or patient's legal representative able to give written informed consent for
     participation in the trial.

Exclusion Criteria:

  -  Acute or chronic infection, or history of active tuberculosis;

  -  History of diseases of central nervous system, cardiovascular system, kidney, liver (
     specified liver function index), digestive system, respiratory system , metabolism
     system;

  -  Patients who have a high risk of infection (with a current infectious disease, a
     chronic infectious disease, a history of serious infectious disease);

  -  Patients who use 5 Unit doses tuberculin skin test are positive( 48-72 hour scleroma
     reading≥5mm);

  -  Patients who currently have, or who have a history of, malignancy;

  -  Patients who lack of understanding ,communication or collaboration, and can't comply
     with the protocols;

  -  Female patients who are breastfeeding or pregnant, who are of childbearing potential.

Inclusion Criteria:

  -  Male smokers aged 18 to 55 years;

  -  History of smoking at least 5 cigarettes daily for the past 12 months;

  -  In good health as verified by medical history, screening examination, and -screening
     laboratory tests

Exclusion Criteria:

  -  History of mifepristone allergy;

  -  Requirement of any form of regular psychotropic medication (antidepressants,
     antipsychotics, or anxiolytics) and recent psychiatric history (in the past 6 months);

  -  Medical illnesses including diabetes, cardiovascular, renal, endocrine, or hepatic
     disorders;

  -  Prolonged QTc interval >450 msec;

  -  History of adrenal insufficiency or a morning plasma cortisol level less than 5 mcg/dl
     at screening;

  -  Hypokalemia at screening (defined as potassium level < 3.5 mEq/L);

  -  Current use of clinically significant CYP 3A4 substrates including, simvastatin,
     lovastatin, cyclosporine, ergotamines, fentanyl, pimozide, quinidine, sirolimus,
     tacrolimus, triazolam, midazolam.

  -  use of rifapentin, phenobarbital, phenytoin, carbamazepine, and St. John's Wort.

  -  Current use of strong 3A4 inhibitors including ketoconazole, itraconazole, nefazodone,
     ritonavir, nelfinavir, indinavir, atazanavir, amprenavir, fosamprenivir, boceprevir,
     clarithromycin, conivaptan, lopinavir, mibefradil, posaconazole, saquinavir,
     telaprevir, telithromycin, voriconazole.

  -  Treatment with systemic corticosteroids

  -  Current use of clinically significant CYP 3A inducers (e.g., rifampin, rifabutin);

  -  Abuse of alcohol or any other illicit or prescription drugs;

  -  Inability to tolerate cold exposure due to conditions such as peripheral -vascular
     disease or Raynaud's phenomenon;

  -  Inability to fulfill all scheduled visits and examination procedures throughout the
     study period.

Inclusion Criteria:

  -  Healthy males and female of non-childbearing potential;

  -  Age of 18-55, inclusive;

  -  Body Mass Index 17.5-34.9 kg/m2, inclusive;

  -  Body weight >50 kg;

  -  Not on any prescription or non-prescription drugs within 7 days or 5 half-lives prior
     to first dose.

Exclusion Criteria:

- Evidence of history of clinically significant hematological, renal, endocrine, pulmonary,
gastrointestinal, cardiovascular, hepatic, psychiatric, neurologic, or allergic disease
(including drug allergises, but excluding untreated, asymptomatic, seasonal allergies at
time of dosing)
